@namespace url("http://www.w3.org/1999/xhtml");
@-moz-document regexp("^https?://www.google..*/(?!(videohp|imghp)).*?") {
  #hplogo {
    width: 277px !important;
    height: 0 !important;
    padding: 86.5px 0 !important;
    margin-bottom: -218px !important;
    background: transparent
                url("data:image/png;base64,")
                center center
                no-repeat
                !important;
  }
  #hplogo *, .gbqfba * { display: none !important; }
  .gbqfba:before, .gbqfba:after {
    font: bold 11px/27px Arial, sans-serif !important;
    vertical-align: top !important;
  }
  .gbqfba:after {
    position: absolute;
    margin-top: 3em;
    visibility: hidden;
  }
  .gbqfba:hover:after { visibility: visible; }
  #gbqfba:before { content: "Go ahead" !important; }
  #gbqfba:after {
    content: "make my day" !important;
    margin-left: -5.5em;
  }
  #gbqfbb:before { content: "Do I feel lucky?" !important; }
  #gbqfbb:after {
    content: "Well, do ya, punk?" !important;
    margin-left: -8em;
  }
}
